import React from 'react';
import './SettingsMenu.css';

interface SettingsMenuProps {
  isOpen: boolean;
  onClose: () => void;
  // We will add more props later for customization callbacks
}

const SettingsMenu: React.FC<SettingsMenuProps> = ({ isOpen, onClose }) => {
  if (!isOpen) {
    return null;
  }

  return (
    <div className="settings-menu-overlay" onClick={onClose}>
      <div className="settings-menu" onClick={(e) => e.stopPropagation()}>
        <h2>Settings</h2>
        <p>Customization options will go here.</p>
        <button onClick={onClose}>Close</button>
        {/* Example: Color pickers, toggles etc. */}
      </div>
    </div>
  );
};

export default SettingsMenu;
